import React from 'react';

export const Card = ({ listOfTodos }) => {
    return (
        <div>
            {listOfTodos.map(todo => {
                return(
                    <ul>
                        <li>{todo.content}</li>
                    </ul>
                )
            })}
        </div>
    )
}

